&lt;p style="margin-left:2.15pt;"&gt;
	With over 100,000,000 particles smaller than 1 cm in low earth orbit, it is critical that shielding will adequately protect from impacts of this size. &amp;nbsp;A 3SLGG is a validated method to accelerate small particles up to 10 km/s.&amp;nbsp; Enabling WSTF to simulate the average LEO velocity of 10 km/s will provide the means to validate ballistic limit equations used to design protective shields. &amp;nbsp;The first phase was accomplished using the 3SLGG code, which provided the optimal beginning geometric and pressure parameters. &amp;nbsp;The next phase will include fabrication of the components, development of procedures, safety/design reviews and build up of the launcher system.&lt;/p&gt;
&lt;p style="margin-left:2.15pt;"&gt;
